import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class FunFactsRentSaleRatio extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="FunFactsRentSaleRatio">
				<div className="RegionID">{this.props.RegionID}</div>
				<div className="Zipcode">{this.props.Zipcode}</div>
				<div className="rent_sale_ratio">{this.props.rent_sale_ratio}</div>
			</div>
		);
	}
}
